import { Button, ButtonText, Pressable, View } from "@gluestack-ui/themed";
import React from "react";
import { StyleSheet } from "react-native";

interface Props {
    label: string;
    bgColor: string;
    onPress: () => void;
}

export const ButtonMd = ({ label, bgColor, onPress }: Props) => {
    return (
        <View>
            <Button
                size="md"
                variant="solid"
                isDisabled={false}
                isFocusVisible={false}
                style={{ ...styles.button, backgroundColor: bgColor }}
                onPress={onPress}
            >
                <ButtonText>{label}</ButtonText>
            </Button>

            <Pressable
                onPress={() => console.log("Hello")}
                p="$5"
                bg="$primary500"
                $hover-bg="$primary400"
            >
                <Text color="white">Press me</Text>
            </Pressable>
        </View>
    );
};

const styles = StyleSheet.create({
    button: {
        padding: 15,
        borderRadius: 5,
    },
    buttonText: {
        color: "#fff",
        fontSize: 18,
    },
});
